SELECT DISTINCT c.customerNumber, c.customerName
FROM customers c
WHERE c.country = 'USA';

SELECT c.customerNumber, c.customerName, c.creditLimit
FROM customers c
WHERE c.creditLimit > 100000;

SELECT p.customerNumber, p.checkNumber, p.paymentDate, p.amount
FROM payments p
WHERE p.customerNumber = 103;

SELECT COUNT(*)
FROM orders
WHERE shippedDate IS NOT NULL;

SELECT o.orderNumber, o.orderDate, o.requiredDate, o.shippedDate, o.status, o.comments
FROM orders o
WHERE o.status = 'Cancelled';

SELECT e.employeeNumber, e.firstName, e.lastName, m.firstName, m.lastName
FROM employees e
JOIN employees m ON e.reportsTo = m.employeeNumber;

SELECT p.productCode, p.productName, p.quantityInStock
FROM products p
WHERE p.quantityInStock < 100;

SELECT o.orderNumber, o.orderDate, o.requiredDate, o.shippedDate
FROM orders o
WHERE o.shippedDate < o.requiredDate;

SELECT *
FROM products
WHERE buyPrice > MSRP;

SELECT c.customerName, e.firstName ||'' || e.lastName AS salesRepName
FROM customers c
JOIN employees e ON c.salesRepEmployeeNumber = e.employeeNumber;

SELECT o.orderNumber, o.orderDate, o.requiredDate, o.shippedDate, o.status
FROM orders o
WHERE o.status = 'In Process';

SELECT *
FROM products
WHERE quantityInStock > 500;

SELECT c.customerName, c.creditLimit
FROM customers c
WHERE c.country = 'France';

SELECT o.orderNumber, o.orderDate, o.requiredDate, o.shippedDate, o.status, o.comments
FROM orders o
WHERE o.comments IS NOT NULL;

SELECT e.employeeNumber, e.firstName, e.lastName
FROM employees e
WHERE e.reportsTo IS NULL;

SELECT *
FROM payments
WHERE paymentDate > '2003-01-01' AND amount > 5000;

SELECT AVG(amount) 
FROM payments 
WHERE YEAR(paymentDate) = 2003;

SELECT *
FROM payments
WHERE paymentDate > '2004-01-01' AND amount > 5000;

SELECT AVG(amount) 
FROM payments 
WHERE YEAR(paymentDate) = 2004;

SELECT *
FROM payments
WHERE paymentDate > '2005-01-01' AND amount > 5000;

SELECT AVG(amount) 
FROM payments 
WHERE YEAR(paymentDate) = 2005;

SELECT e.employeeNumber, e.firstName, e.lastName, m.employeeNumber, m.firstName, m.lastName
FROM employees e
JOIN employees m ON e.reportsTo = m.employeeNumber;

SELECT COUNT(*) FROM orders o
JOIN customers c ON o.customerNumber = c.customerNumber
WHERE c.country = 'Japan' AND o.status = 'On Hold';

SELECT AVG(SUM(od.quantityOrdered * o.priceEach)) AS avg_order_total 
FROM orders o JOIN orderdetails od ON o.orderNumber = od.orderNumber 
WHERE o.status = 'On Hold';
